	/** An attachment that displays a textured quadrilateral.
	 *
	 * See [Region attachments](http://esotericsoftware.com/spine-regions) in the Spine User Guide. */
	class RegionAttachment extends Attachment {
	    /** The local x translation. */
	    x = 0;
	    /** The local y translation. */
	    y = 0;
	    /** The local scaleX. */
	    scaleX = 1;
	    /** The local scaleY. */
	    scaleY = 1;
	    /** The local rotation. */
	    rotation = 0;
	    /** The width of the region attachment in Spine. */
	    width = 0;
	    /** The height of the region attachment in Spine. */
	    height = 0;
	    /** The color to tint the region attachment. */
	    color = new Color(1, 1, 1, 1);
	    /** The name of the texture region for this attachment. */
	    path;
	    region = null;
	    sequence = null;
	    /** For each of the 4 vertices, a pair of <code>x,y</code> values that is the local position of the vertex.
	     *
	     * See {@link #updateOffset()}. */
	    offset = Utils.newFloatArray(8);
	    uvs = Utils.newFloatArray(8);
	    tempColor = new Color(1, 1, 1, 1);
	    constructor(name, path) {
	        super(name);
	        this.path = path;
	    }
	    /** Calculates the {@link #offset} using the region settings. Must be called after changing region settings. */
	    updateRegion() {
	        if (!this.region)
	            throw new Error("Region not set.");
	        let region = this.region;
	        let uvs = this.uvs;
	        if (region == null) {
	            uvs[0] = 0;
	            uvs[1] = 0;
	            uvs[2] = 0;
	            uvs[3] = 1;
	            uvs[4] = 1;
	            uvs[5] = 1;
	            uvs[6] = 1;
	            uvs[7] = 0;
	            return;
	        }
	        let regionScaleX = this.width / this.region.originalWidth * this.scaleX;
	        let regionScaleY = this.height / this.region.originalHeight * this.scaleY;
	        let localX = -this.width / 2 * this.scaleX + this.region.offsetX * regionScaleX;
	        let localY = -this.height / 2 * this.scaleY + this.region.offsetY * regionScaleY;
	        let localX2 = localX + this.region.width * regionScaleX;
	        let localY2 = localY + this.region.height * regionScaleY;
	        let radians = this.rotation * MathUtils.degRad;
	        let cos = Math.cos(radians);
	        let sin = Math.sin(radians);
	        let x = this.x, y = this.y;
	        let localXCos = localX * cos + x;
	        let localXSin = localX * sin;
	        let localYCos = localY * cos + y;
	        let localYSin = localY * sin;
	        let localX2Cos = localX2 * cos + x;
	        let localX2Sin = localX2 * sin;
	        let localY2Cos = localY2 * cos + y;
	        let localY2Sin = localY2 * sin;
	        let offset = this.offset;
	        offset[0] = localXCos - localYSin;
	        offset[1] = localYCos + localXSin;
	        offset[2] = localXCos - localY2Sin;
	        offset[3] = localY2Cos + localXSin;
	        offset[4] = localX2Cos - localY2Sin;
	        offset[5] = localY2Cos + localX2Sin;
	        offset[6] = localX2Cos - localYSin;
	        offset[7] = localYCos + localX2Sin;
	        if (region.degrees == 90) {
	            uvs[0] = region.u2;
	            uvs[1] = region.v2;
	            uvs[2] = region.u;
	            uvs[3] = region.v2;
	            uvs[4] = region.u;
	            uvs[5] = region.v;
	            uvs[6] = region.u2;
	            uvs[7] = region.v;
	        }
	        else {
	            uvs[0] = region.u;
	            uvs[1] = region.v2;
	            uvs[2] = region.u;
	            uvs[3] = region.v;
	            uvs[4] = region.u2;
	            uvs[5] = region.v;
	            uvs[6] = region.u2;
	            uvs[7] = region.v2;
	        }
	    }
	    /** Transforms the attachment's four vertices to world coordinates. If the attachment has a {@link #sequence}, the region may
	     * be changed.
	     * <p>
	     * See <a href="http://esotericsoftware.com/spine-runtime-skeletons#World-transforms">World transforms</a> in the Spine
	     * Runtimes Guide.
	     * @param worldVertices The output world vertices. Must have a length >= <code>offset</code> + 8.
	     * @param offset The <code>worldVertices</code> index to begin writing values.
	     * @param stride The number of <code>worldVertices</code> entries between the value pairs written. */
	    computeWorldVertices(slot, worldVertices, offset, stride) {
	        if (this.sequence != null)
	            this.sequence.apply(slot, this);
	        let bone = slot.bone;
	        let vertexOffset = this.offset;
	        let x = bone.worldX, y = bone.worldY;
	        let a = bone.a, b = bone.b, c = bone.c, d = bone.d;
	        let offsetX = 0, offsetY = 0;
	        offsetX = vertexOffset[0];
	        offsetY = vertexOffset[1];
	        worldVertices[offset] = offsetX * a + offsetY * b + x; // br
	        worldVertices[offset + 1] = offsetX * c + offsetY * d + y;
	        offset += stride;
	        offsetX = vertexOffset[2];
	        offsetY = vertexOffset[3];
	        worldVertices[offset] = offsetX * a + offsetY * b + x; // bl
	        worldVertices[offset + 1] = offsetX * c + offsetY * d + y;
	        offset += stride;
	        offsetX = vertexOffset[4];
	        offsetY = vertexOffset[5];
	        worldVertices[offset] = offsetX * a + offsetY * b + x; // ul
	        worldVertices[offset + 1] = offsetX * c + offsetY * d + y;
	        offset += stride;
	        offsetX = vertexOffset[6];
	        offsetY = vertexOffset[7];
	        worldVertices[offset] = offsetX * a + offsetY * b + x; // ur
	        worldVertices[offset + 1] = offsetX * c + offsetY * d + y;
	    }
	    copy() {
	        let copy = new RegionAttachment(this.name, this.path);
	        copy.region = this.region;
	        copy.x = this.x;
	        copy.y = this.y;
	        copy.scaleX = this.scaleX;
	        copy.scaleY = this.scaleY;
	        copy.rotation = this.rotation;
	        copy.width = this.width;
	        copy.height = this.height;
	        Utils.arrayCopy(this.uvs, 0, copy.uvs, 0, 8);
	        Utils.arrayCopy(this.offset, 0, copy.offset, 0, 8);
	        copy.color.setFromColor(this.color);
	        copy.sequence = this.sequence != null ? this.sequence.copy() : null;
	        return copy;
	    }
	    static X1 = 0;
	    static Y1 = 1;
	    static C1R = 2;
	    static C1G = 3;
	    static C1B = 4;
	    static C1A = 5;
	    static U1 = 6;
	    static V1 = 7;
	    static X2 = 8;
	    static Y2 = 9;
	    static C2R = 10;
	    static C2G = 11;
	    static C2B = 12;
	    static C2A = 13;
	    static U2 = 14;
	    static V2 = 15;
	    static X3 = 16;
	    static Y3 = 17;
	    static C3R = 18;
	    static C3G = 19;
	    static C3B = 20;
	    static C3A = 21;
	    static U3 = 22;
	    static V3 = 23;
	    static X4 = 24;
	    static Y4 = 25;
	    static C4R = 26;
	    static C4G = 27;
	    static C4B = 28;
	    static C4A = 29;
	    static U4 = 30;
	    static V4 = 31;
	}

